                    <InputText placeholder="unit" />
                    <InputText placeholder="sizes" />
                    <InputText placeholder="placement" />
                </SimpleFlexWrapper>
                <AddButton/>
            </WrapAreas>
        </SimpleFlexWrapper>
    );
}

export { CsvGeneration };
